import React, { Component } from 'react';
import './flexbox.css';

class SearchListItem extends Component {
    constructor(props) {
        super()
        this.state={
            imagePath: props.img,
            id: props.id
        };
    }
    render() {
        return (
            <li key={this.state.id}>
                <img src={this.state.imagePath} alt="broken" />
            </li>
        )
    }
};

export default SearchListItem;
